INSERT INTO `disease_databank_table` (`disease_id`, `disease_name`, `disease_symptoms`, `disease_condition_development`, `disease_management_control`, `disease_example_pic`, `disease_sciname`) VALUES
(1, 'Alternaria Leaf Spot', 'Lesions on leaves start as small, dark spots that gradually enlarge and turn brown to gray with concentric zones resembling that of a target.  Lesions may have purplish or blackish border, chlorotic halo is evident if surrounding area of the leaf is still green. Older plants are more susceptible that the younger ones.', 'Wet weather conditions, relative humidity above 95% and temperature range of 28-31°C are necessary for spore germination and infection. The pathogen can survive on infected plant debris and on the soil and are spread by wind, rain splashes and runoff water. It can survive in the soil. The bacteria can spread by insects and by cultural practices such as irrigation and farm equipment\'s/machinery. Infection is through damaged areas, often caused by fertilizer burn or hail injury in the ﬁeld, but can be associated with the damage during harvesting.', 'Maintain good field sanitation, remove infected plants/plant parts and dispose properly. Crop rotation with non-host crop for at least 3 years to reduce the amount of primary inoculum. Remove volunteer and weedy crucifers that may serve as alternate hosts for the pathogen. Spray with copper-based fungicides (e.g. Cupravit®, Vitigran Blue®, Nordox 50®), Mancozeb (Dithane M-45®) or Chlorothalonil (Daconil 2787®) at the initial onset of the disease.', , 'Alternaria brassicae');
INSERT INTO `disease_databank_table` (`disease_id`, `disease_name`, `disease_symptoms`, `disease_condition_development`, `disease_management_control`, `disease_example_pic`, `disease_sciname`) VALUES
(2, 'Bacterial Spot', 'Early symptoms appear as water-soaked lesions and expand rapidly. P. marginalis causes a wet, slimy soft rot and unpleasant smell.', 'The disease thrives in warm, humid climates and is most serious in tropical, subtropical, and humid continental regions. It occurs in the field but more serious during transportation or in the storage. It can survive in the soil. The bacteria can spread by insects and by cultural practices such as irrigation and farm equipments/machinery. Infection is through damaged areas, often caused by fertilizer burn or hail injury in the ﬁeld, but can be associated with the damage during harvesting.', 'Use of pathogen-free seeds. Crop rotation. Strict field sanitation and monitoring for early symptoms. Remove infected plants from seedbeds and close monitoring of the remaining plants. Disinfection of tools and equipment after use. Remove volunteer and weedy crucifers that may serve as alternate hosts for the pathogen. Spray with protective copper-based fungicides (e.g. Cupravit®, Vitigran Blue®, Nordox 50®).', , 'Pectobacterium carotovorum ssp');
INSERT INTO `disease_databank_table` (`disease_id`, `disease_name`, `disease_symptoms`, `disease_condition_development`, `disease_management_control`, `disease_example_pic`, `disease_sciname`) VALUES
(3, 'Downy Mildew', 'Leaf symptoms appear as yellowish, irregular lesions on the upper surface corresponding to a white fluffy or downy growth develops on the undersides of leaves. Older lesions become dry, turn brown and papery in texture and may cause the entire leaf to drop. The head of broccoli and cauliflower curds infected with black spots within or on the surface.', 'Downy mildew causes damage from the seedling (cotyledons) to harvesting stage. The spore releases in the morning or after sunrise. It is spread by the wind although leaf wetness is required for infection. Cool, moist conditions favour the disease. The fungus can survive on brassica weeds, in crop debris or soil for several months, even in the absence of a host.', 'The fungus can survive on brassica weeds, in crop debris or soil for several months, even in the absence of a host. Plow in old crops as soon as harvesting is completed and ensure all crop residue is decomposed before planting. Spray to fruit set with a protectant fungicide. In wet weather and after fruit set, use a systemic fungicide. Wider space in planting allow better airflow and spray penetration. Avoid overhead irrigation. Spray with fungicides such as Mancozeb (Dithane M-45®), Chlorothalonil (Daconil 2787®) or metalaxyl+mancozeb (Ridomil®).', , 'Hyaloperonospora parasitica');

